package me.phh.treble.app

import okhttp3.MediaType.Companion.toMediaType
import okhttp3.OkHttpClient
import okhttp3.Protocol
import okhttp3.Response
import okhttp3.ResponseBody.Companion.toResponseBody
import org.junit.Before
import org.junit.Test
import org.junit.runner.RunWith
import org.robolectric.Robolectric
import org.robolectric.RobolectricTestRunner
import java.lang.reflect.Field

@RunWith(RobolectricTestRunner::class)
class StringProviderTest {

    private lateinit var stringProvider: StringProvider

    @Before
    fun setup() {
        stringProvider = Robolectric.buildContentProvider(StringProvider::class.java).create().get()
    }

    @Test
    fun testFetchString() {
        val client = OkHttpClient.Builder()
            .addInterceptor { chain ->
                val encoded = ""

                val response = Response.Builder()
                    .request(chain.request())
                    .protocol(Protocol.HTTP_1_1)
                    .code(200)
                    .message("OK")
                    .body(encoded.toResponseBody("text/plain".toMediaType()))
                    .build()
                response
            }
            .build()

        // Use reflection to set the client
        val clientField: Field = StringProvider::class.java.getDeclaredField("client")
        clientField.isAccessible = true
        clientField.set(stringProvider, client)

        // Use reflection to call the private method
        val method = StringProvider::class.java.getDeclaredMethod("fetchString")
        method.isAccessible = true
        method.invoke(stringProvider)
    }
}
